public class Solution {
    public static int solution() {
        // Q: The sum of three consecutive even numbers is 162. What is the smallest of the three numbers?
        int sum = 162;
        // Let the smallest even number be x. Then the three consecutive even numbers are x, x+2, x+4.
        // Therefore, x + (x + 2) + (x + 4) = 162
        // Simplifying gives us 3x + 6 = 162
        // So, 3x = 162 - 6
        // 3x = 156
        // x = 156 / 3
        int smallestEvenNumber = (sum - 6) / 3;
        int result = smallestEvenNumber;

        return result;
    }

    public static void main(String[] args) {
        System.out.print(solution());
    }
}
